restaurant_name_pattern = r'<div class="styles_restaurantName__5VIQZ styles_restaurantNameBold__2OmFY" bis_skin_checked="1">(.*?)<\/div>'
dish_name_pattern = r'<h3 class="styles_itemNameText__3ZmZZ">(.*?)<\/h3>'
rating_pattern = r'<span class="styles_restaurantMetaRating__3MhTg">(.*?)<\/span>'
price_pattern = r'<span class="rupee">([0-9.]+)<\/span>'
link_pattern = r'<a href="(.*?)"'

# Extract restaurant name
restaurant_name = re.findall(restaurant_name_pattern, data)

# Extract dish name
dish_name = re.findall(dish_name_pattern, data)

# Extract rating
rating = re.findall(rating_pattern, data)

# Extract price
price = re.findall(price_pattern, data)

# Extract links
links = re.findall(link_pattern, data)

# Add prefix to links
prefixed_links = ['https://www.swiggy.com' + link for link in links]

# Prepare data for CSV
rows = zip(restaurant_name, dish_name, price, rating,prefixed_links )

# Set CSV file path
csv_file = r'C:\Users\Abdul\swiggy_paneer.csv'

# Write data to CSV file
with open(csv_file, 'w', newline='') as file:
    writer = csv.writer(file)
    writer.writerow(['Restaurant Name', 'Dish Name', 'Price', 'Rating', 'Link'])  # Write header
    writer.writerows(rows)  # Write rows

print("Data has been saved to", csv_file)
